import React from "react";
import Card from "./Cards";
import Sdata from './Sdata';

const favSeries ="amzoon";
const FavS = () =>{
if(favSeries === "netflix"){
    return(
        <Card
        key={Sdata[0].id}
        imgsrc={Sdata[0].imgsrc}
        title={Sdata[0].title}
        mname={Sdata[0].mname}
        link={Sdata[0].link}
        />
    );
}
    else {
    return(
        <Card
        key={Sdata[2].id}
        imgsrc={Sdata[2].imgsrc}
        title={Sdata[2].title}
        mname={Sdata[2].mname}
        link={Sdata[2].link}
        />
        );

    }
    
};
const App = () => (
    <>
    <h1 className="heading_style">List of top netflix movies</h1>
    <FavS/>
    </>
);
export default App;
